import React, { useState } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import { registerApi } from '../apis/Api';
import { toast } from 'react-toastify';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';

import forestImage1 from '../images/traffic.png'; // Replace with your image URLs
import forestImage2 from '../images/traffic.png';
import forestImage3 from '../images/traffic.png';

const Register = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phoneNo, setPhoneNo] = useState('');
  const [password, setPassword] = useState('');

  const changeFirstName = (e) => {
    setFirstName(e.target.value);
  };
  const changeLastName = (e) => {
    setLastName(e.target.value);
  };
  const changePhoneNo = (e) => {
    setPhoneNo(e.target.value);
  };
  const changePassword = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log(firstName, lastName, phoneNo, password);

    const data = {
      firstName: firstName,
      lastName: lastName,
      phoneNo: phoneNo,
      password: password,
    };
    registerApi(data)
      .then((res) => {
        if (res.data.success === true) {
          toast.success(res.data.message);
        } else {
          toast.error(res.data.message);
        }
      })
      .catch((err) => {
        console.log(err);
        toast.error('Internal Server Error');
      });
  };

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  const defaultTheme = createTheme();

  return (
    <ThemeProvider theme={defaultTheme}>
      <Box
        sx={{
          display: 'flex',
          height: '100vh',
        }}
      >
        <CssBaseline />
        <Box
          sx={{
            p: 9,
            width: '50%',
            borderRight: '1px solid #ccc',
          }}
        >
          <Paper
            elevation={8}
            square
            sx={{
              p: 9,
              border: '1px solid #ccc',
              borderRadius: '8px',
            }}
          >
            <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
              <LockOutlinedIcon />
            </Avatar>
            <Typography component="h1" variant="h5">
              Register
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField
                  margin="normal"
                  name="firstName"
                  required
                  fullWidth
                  label="First Name"
                  onChange={changeFirstName}
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  name="lastName"
                  margin="normal"
                  required
                  fullWidth
                  label="Last Name"
                  onChange={changeLastName}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  name="phoneNumber"
                  required
                  fullWidth
                  label="Phone number"
                  onChange={changePhoneNo}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  name="password"
                  required
                  fullWidth
                  label="Password"
                  onChange={changePassword}
                />
              </Grid>
              <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{
                  mt: 2,
                  mb: 2,
                  mx: 'auto',
                  width: '50%',
                  fontSize: 'medium',
                  color: 'black',
                  backgroundColor: 'grey',
                  '&:hover': {
                    backgroundColor: 'light-blue',
                  },
                }}
              >
                Sign In
              </Button>
              <Grid container justifyContent="center">
                <Grid item xs={12} sx={{ textAlign: 'center', mt: 2, mb: 2 }}>
                  <span>
                    Already have an account?{' '}
                    <Link href="#" variant="body2" sx={{ textDecoration: 'underline' }}>
                      Log In
                    </Link>
                  </span>
                </Grid>
              </Grid>
            </Grid>
          </Paper>
        </Box>
        <Box
          sx={{
            p: 9,
            width: '55%',
          }}
        >
          <Slider {...sliderSettings}>
            <div>
              <Box
                sx={{
                  backgroundImage: `url(${forestImage1})`,
                  backgroundRepeat: 'no-repeat',
                  backgroundColor: 'white',
                  backgroundSize: 'cover',
                  backgroundPosition: 'center',
                  height: '72%',
                  marginTop: '8%',
                }}
              />
            </div>
            <div>
              <Box
                sx={{
                  backgroundImage: `url(${forestImage2})`,
                  backgroundRepeat: 'no-repeat',
                  backgroundColor: 'white',
                  backgroundSize: 'cover',
                  backgroundPosition: 'center',
                  height: '72%',
                  marginTop: '8%',
                }}
              />
            </div>
            <div>
              <Box
                sx={{
                  backgroundImage: `url(${forestImage3})`,
                  backgroundRepeat: 'no-repeat',
                  backgroundColor: 'white',
                  backgroundSize: 'cover',
                  backgroundPosition: 'center',
                  height: '72%',
                  marginTop: '8%',
                }}
              />
            </div>
          </Slider>
        </Box>
      </Box>
    </ThemeProvider>
  );
};

export default Register;
